{
  "translationLines": [
    {
      "lineNumber": 17791,
      "originalJapaneseLine": "「パランナイツはヘルマンやリーザスにも負けない、",
      "translatedEnglishLine": "\"The Palannights have skill and training that rival even Helman and Leesas,"
    },
    {
      "lineNumber": 17792,
      "originalJapaneseLine": "　素晴らしい練度と聞きました。",
      "translatedEnglishLine": "I have heard their proficiency is outstanding."
    },
    {
      "lineNumber": 17793,
      "originalJapaneseLine": "　きちんと確認させて頂きます」",
      "translatedEnglishLine": "I would like to properly confirm that.\""
    },
    {
      "lineNumber": 17794,
      "originalJapaneseLine": "「どうぞ、存分に」",
      "translatedEnglishLine": "\"Go ahead, as much as you wish.\""
    },
    {
      "lineNumber": 17795,
      "originalJapaneseLine": "「あのう……すみません。",
      "translatedEnglishLine": "\"Um… excuse me."
    },
    {
      "lineNumber": 17796,
      "originalJapaneseLine": "　パランチョ王国って、どんな国なんですか？",
      "translatedEnglishLine": "What kind of country is the Kingdom of Paranco?"
    },
    {
      "lineNumber": 17797,
      "originalJapaneseLine": "　私、聞いたことなくて……」",
      "translatedEnglishLine": "I've never heard of it before...\""
    },
    {
      "lineNumber": 17798,
      "originalJapaneseLine": "「なんだ、知らんのかお前。不勉強だな」",
      "translatedEnglishLine": "\"What, you don't know? That's unstudious of you.\""
    },
    {
      "lineNumber": 17799,
      "originalJapaneseLine": "「うっ……ランス様はご存じなんですか？」",
      "translatedEnglishLine": "\"Ugh... Lord Rance, do you know about it?\""
    },
    {
      "lineNumber": 17800,
      "originalJapaneseLine": "「俺が知るわけ無いだろう。",
      "translatedEnglishLine": "\"There's no way I would know."
    },
    {
      "lineNumber": 17801,
      "originalJapaneseLine": "　どうせ豆粒みたいな国だ」",
      "translatedEnglishLine": "It's probably just a tiny, insignificant country anyway.\""
    },
    {
      "lineNumber": 17802,
      "originalJapaneseLine": "「ら、ランス様っ……！",
      "translatedEnglishLine": "\"L-Lord Rance...!"
    },
    {
      "lineNumber": 17803,
      "originalJapaneseLine": "　ピッテンさんがいるのに……」",
      "translatedEnglishLine": "Even though Pitten-san is here...\""
    },
    {
      "lineNumber": 17804,
      "originalJapaneseLine": "「豆粒か。言い得て妙かもしれんな」",
      "translatedEnglishLine": "\"A tiny speck, huh? That might be an apt description.\""
    },
    {
      "lineNumber": 17805,
      "originalJapaneseLine": "「あの、すみません……」",
      "translatedEnglishLine": "\"Um, excuse me...\""
    },
    {
      "lineNumber": 17806,
      "originalJapaneseLine": "「パランチョは……そうだな。こんな国だ」",
      "translatedEnglishLine": "\"Paranco is... well, it's a country like this.\""
    },
    {
      "lineNumber": 17807,
      "originalJapaneseLine": "ピッテンが手を拍つと、",
      "translatedEnglishLine": "When Pitten clapped his hands,"
    },
    {
      "lineNumber": 17808,
      "originalJapaneseLine": "従者がひとつのザルを持ってきた。",
      "translatedEnglishLine": "A servant brought over a basket."
    },
    {
      "lineNumber": 17809,
      "originalJapaneseLine": "「……なんだこりゃ？　豆か？」",
      "translatedEnglishLine": "\"...What is this? Beans?\""
    },
    {
      "lineNumber": 17810,
      "originalJapaneseLine": "「少し囓ってみろ」",
      "translatedEnglishLine": "\"Try nibbling on one.\""
    },
    {
      "lineNumber": 17811,
      "originalJapaneseLine": "「ただの石とかだったら頭カチ割るからな……",
      "translatedEnglishLine": "\"If it's just a stone or something, I'll crack your head open..."
    },
    {
      "lineNumber": 17812,
      "originalJapaneseLine": "　ん、んん……っ、げほっ、辛っ！」",
      "translatedEnglishLine": "Mmm, mmm... *cough* Spicy!\""
    },
    {
      "lineNumber": 17813,
      "originalJapaneseLine": "「あ、これ……香辛料のピリン豆、ですか？",
      "translatedEnglishLine": "\"Ah, this... is this 'Pirin Beans,' the spice?"
    },
    {
      "lineNumber": 17814,
      "originalJapaneseLine": "　たまに、お店ですごい値段で売ってますけど……」",
      "translatedEnglishLine": "Sometimes it's sold at shops for an incredible price...\""
    },
    {
      "lineNumber": 17815,
      "originalJapaneseLine": "「うちの国の名産でな。",
      "translatedEnglishLine": "\"It's a specialty product of our country."
    },
    {
      "lineNumber": 17816,
      "originalJapaneseLine": "　価値はあるが採れるのは少量だ」",
      "translatedEnglishLine": "It has value, but only a small amount can be harvested.\""
    },
    {
      "lineNumber": 17817,
      "originalJapaneseLine": "「……なるほど。",
      "translatedEnglishLine": "\"...I see."
    },
    {
      "lineNumber": 17818,
      "originalJapaneseLine": "　確かに、パランチョはそんな国ですね」",
      "translatedEnglishLine": "Indeed, Paranco is that kind of country.\""
    },
    {
      "lineNumber": 17819,
      "originalJapaneseLine": "「まぁ、そんなところだ。ではな」",
      "translatedEnglishLine": "\"Well, that's about it. Farewell.\""
    },
    {
      "lineNumber": 17820,
      "originalJapaneseLine": "口元に笑みを少しだけ浮かべると、",
      "translatedEnglishLine": "With a slight smile at the corner of his mouth,"
    },
    {
      "lineNumber": 17821,
      "originalJapaneseLine": "ピッテンはマントを翻して退出した。",
      "translatedEnglishLine": "Pitten flipped his cloak and exited."
    },
    {
      "lineNumber": 17822,
      "originalJapaneseLine": "「ちっ。雑魚なのを誤魔化す為に、",
      "translatedEnglishLine": "\"Tch. Saying nonsense just to cover up how weak they are..."
    },
    {
      "lineNumber": 17823,
      "originalJapaneseLine": "　訳の分からん事言いやがって……ぺぺっ」",
      "translatedEnglishLine": "What a bunch of nonsense... pfft.\""
    },
    {
      "lineNumber": 17824,
      "originalJapaneseLine": "「そ、そうではないと思いますけど……」",
      "translatedEnglishLine": "\"I-I don't think that's the case though...\""
    },
    {
      "lineNumber": 17825,
      "originalJapaneseLine": "「しかし、ここはいつも賑やかだな……",
      "translatedEnglishLine": "\"Still, it's always lively here..."
    },
    {
      "lineNumber": 17826,
      "originalJapaneseLine": "　城主のせいか」",
      "translatedEnglishLine": "Maybe because of the lord of the castle.\""
    },
    {
      "lineNumber": 17827,
      "originalJapaneseLine": "ピッテンは、所用でランス城にやって来ていた。",
      "translatedEnglishLine": "Pitten had come to Rance Castle on some business."
    },
    {
      "lineNumber": 17828,
      "originalJapaneseLine": "「そ、そんな！　ひどいです、ランス兄様！」",
      "translatedEnglishLine": "\"N-No way! That's terrible, Brother Rance!\""
    },
    {
      "lineNumber": 17829,
      "originalJapaneseLine": "「…………ん？」",
      "translatedEnglishLine": "\"...Hmm?\""
    },
    {
      "lineNumber": 17830,
      "originalJapaneseLine": "「食後に甘い物があると良いって言ってたから、",
      "translatedEnglishLine": "\"You said it would be nice to have something sweet after the meal,"
    },
    {
      "lineNumber": 17831,
      "originalJapaneseLine": "　作ったのにー！」",
      "translatedEnglishLine": "so I made some!\""
    },
    {
      "lineNumber": 17832,
      "originalJapaneseLine": "「ぐっ……だがその……団子じゃないか！",
      "translatedEnglishLine": "\"Ugh... but, that's... dango, isn't it!"
    },
    {
      "lineNumber": 17833,
      "originalJapaneseLine": "　今日は一段と、色艶が……」",
      "translatedEnglishLine": "Today it looks even more colorful and glossy...\""
    },
    {
      "lineNumber": 17834,
      "originalJapaneseLine": "「い、いつものがダメだって言うから、",
      "translatedEnglishLine": "\"Y-You said the usual one was no good,"
    },
    {
      "lineNumber": 17835,
      "originalJapaneseLine": "　少し変えてみたんです！」",
      "translatedEnglishLine": "so I tried changing it a bit!\""
    },
    {
      "lineNumber": 17836,
      "originalJapaneseLine": "「死ぬ……これは死ぬぞ！　人類が滅ぶ！」",
      "translatedEnglishLine": "\"I'm going to die... This will kill me! Humanity will perish!\""
    },
    {
      "lineNumber": 17837,
      "originalJapaneseLine": "「わーん！　そ、そこまで言わなくても……」",
      "translatedEnglishLine": "\"Waaah! Y-You don't have to say it that way...\""
    },
    {
      "lineNumber": 17838,
      "originalJapaneseLine": "「意外だな。ランスが少女の願いを無碍にする類の",
      "translatedEnglishLine": "\"Surprising. I didn't think Rance was the type to harshly reject a girl's wish."
    },
    {
      "lineNumber": 17839,
      "originalJapaneseLine": "　人間とは思わなかったが」",
      "translatedEnglishLine": "But I guess I was wrong.\""
    },
    {
      "lineNumber": 17840,
      "originalJapaneseLine": "「ああん！？　金ぴか野郎か！",
      "translatedEnglishLine": "\"Huh!? You shiny-golden guy!\""
    }
  ]
}

